// src/App.jsx
import React, { useState } from 'react';

const App = () => {
  const [places] = useState(['Đà Nẵng', 'Hội An', 'Huế']);
  return (
    <div className="p-4">
      <MapRoute places={places} />
    </div>
  );
};

export default App;
